import React from 'react';
import Lottie from 'react-lottie';
import anim from './images/ciclista_salita.json';

const Header = () => {
    return (
        <div>
            <Lottie options={{
                loop: true,
                autoplay: true, 
                animationData: anim,
                rendererSettings: {
                    preserveAspectRatio: 'xMidYMid slice'
                }
            }}
                height={200}
                width={200}
            />  
            <h1>ToDo List</h1>

        </div>
    );
};

export default Header;
